function initMap(){"geolocation"in navigator?navigator.geolocation.getCurrentPosition(function(o){console.log(o.coords.latitude,o.coords.longitude);var a=o.coords.longitude,n=o.coords.latitude;mapLocation={lat:n,lng:a};var t=new google.maps.Map(document.getElementById("map_location"),{zoom:4,center:mapLocation});new google.maps.Marker({position:mapLocation,map:t})}):console.warn("Geolocation is not available")}var mapLocation={};